    [],nt"revision_timestamp": "2015-05-07T15:20:21.331966",nt"name": "low-energy-electronic-ignition-system-for-nofbx-thrusters-project",nt"isopen":
    true,nt"url": null,nt"notes": "NOFBX propulsion technology is being developed
    actively for a number of applications including a flight experiment on the International
    Space Station NOFBX propellant has unique electrical properties that allow the potential
    for development of an extremely low energy ignition mechanism when coupled with
    the design of an NOFBX combustion chamber. This has the potential for dramatically
    reducing the volume, mass, voltage, and electromagnetic interference (EMI) emissions.
    The development we are proposing is a very low energy ignition system that utilizes
    the unique attributes of the NOFBXTM propellant that minimizes the volume, mass,
    and voltage of a block redundant system to be used in NOFBX propulsion systems.",nt"license_title":
